    }
    render(element) {
        console.log(this.props);
        return (
            <div>

                <Row sm='4'>
                    <Col xl="4">
                        <CardGroup>
                            <Card body inverse style={{ backgroundColor: '#333', borderColor: 'primary' }}>
                                <CardTitle>{element.displayName}</CardTitle>
                                <CardText><input type='file' id={element.fileType} active onChange={this.handleselectedFile}></input></CardText>
                                <Button color='success' active onClick={this.handleUpload}>Upload</Button>
                                <Button color='primary' disabled onClick={this.handleDownload}>Download</Button>
                                <Button color='danger' disabled onClick={this.handleDelete}>Archive</Button>
                                <Buttons />
                            </Card>
                        </CardGroup>
                    </Col>

                </Row>




            </div>
        );
    }



}

export default Buttons;
